INSERT INTO `bring` VALUES ('1', '14', '1', '凉凉的，很不错。洗了就拿去幼儿园了，孩子在幼儿园的褥子是丝绵的，蒸的孩儿难受，每次拿家里洗时床单都是湿的。有了这个我就安心了好多', '宝宝用的放心妈妈用的安心', './src/assets/images/user1.jpg');
INSERT INTO `bring` VALUES ('2', '15', '2', '这个布料很特别，干的时候柔软，湿的时候硬，比一般的布料要凉快一点点，做工精细，手感不错，发货快，包装好。', '欧孕秋冬款加厚彩棉分腿睡袋', './src/assets/images/user1.jpg');
INSERT INTO `bring` VALUES ('3', '14', '3', '凉席很不错呢，已经给宝宝用上了，就是湿的时候感觉好硬，干了就好了，宝宝很喜欢躺上面', '宝宝用的放心妈妈用的安心', './src/assets/images/user1.jpg');
INSERT INTO `bring` VALUES ('4', '19', '4', '感觉还不错的说，已经给宝宝用上了。挺开心的。', '欧孕秋冬款加厚彩棉分腿睡袋', './src/assets/images/user1.jpg');
INSERT INTO `bring` VALUES ('5', '18', '5', '关注了很久的，身边宝妈大多都推荐这款凉席，收到实物手感超好的。', '宝宝用的放心妈妈用的安心', './src/assets/images/user1.jpg');
INSERT INTO `bring` VALUES ('6', '20', '6', '宝贝还不错，挺柔软的，也挺厚实的，还没洗，不知道洗了以后能怎么样', '欧孕秋冬款加厚彩棉分腿睡袋', './src/assets/images/user1.jpg');
INSERT INTO `bring` VALUES ('7', '14', '7', '是良良正品，良良的东西还是有质量保证的。感觉麻的效果更好一些。', '欧孕 春夏款单层婴儿分腿睡袋', './src/assets/images/user1.jpg');
INSERT INTO `bring` VALUES ('8', '15', '8', '昨天发货，今天就收到了。是正品，摸着凉凉的，囤货中', '宝宝用的放心妈妈用的安心', './src/assets/images/user1.jpg');
